import DataTable from 'react-data-table-component';

export default function TabularTable() {
    //define data array
    const columns = [
        {
            name: "ID",
            selector: (row) => row.personID,
            sortable: true
        },
        {
            name: "Full Name",
            selector: (row) => row.fullName,
            sortable: true
        },
        {
            name: "Height",
            selector: (row) => row.height,
            sortable: true
        },
        {
            name: "eyeColor",
            selector: (row) => row.eyeColor,
            sortable: true
        },
    ];

    const rows = [
        {
            personID: 1,
            fullName: "Kate Shein",
            height: "1.79m",
            eyeColor: "blue",
        },
        //....remaining objects for the 2nd to 14th person
        {
            personID: 15,
            fullName: "Isabella Thompson",
            height: "1.79m",
            eyeColor: "blue",
        },
    ];

    return (

        <div class="container">
            <DataTable
                columns={columns}
                data={rows}
                fixedHeader
                title="React-Data-Table-Component Tutorial."
            />
        </div>
    );
}
